import './reset.css'

import './App.css';
import './build/main.css'
import {Helmet} from "react-helmet";

import Header from './organism/Header'
function App() {

  return (
    <>
    <div>
      <Header />
      <Helmet>
      <script src="my-react-app\src\molecules\profileArea\profile.js" type="text/javascript" />
    </Helmet>
      </div>
  </>
  );
}

export default App;
